using System;
using System.Collections.Generic;
using System.Linq;
					
public class Program
{	
	public static void Main()
	{
	 	var readings = input.Split(new string[] { "\r\n" }, StringSplitOptions.None);
		
		var total = 0;
		foreach (string reading in readings) 
		{		
			var inputs = reading.Split(new string[] { "|" }, StringSplitOptions.None)[0].Trim()
									.Split(new string[] { " " }, StringSplitOptions.None);
			
			var outputs = reading.Split(new string[] { "|" }, StringSplitOptions.None)[1].Trim()
									.Split(new string[] { " " }, StringSplitOptions.None).ToList();
			
			var orderedSets = GetOrderedSignalPatterns(inputs);
			for (int i = 0; i < outputs.Count(); i++) 
			{
				var s = new HashSet<char>(outputs[i]);
				for (int j = 0; j < orderedSets.Length; j++) 
				{
					if (s.SetEquals(orderedSets[j]))
					{
						total += j * (int)Math.Pow(10, 3-i);
						continue;
					}
				}
			}		
		}
		
		Console.WriteLine(total);
	}
	
	public static HashSet<char>[] GetOrderedSignalPatterns(string[] inputs) 
	{
		HashSet<char>[] sets = new HashSet<char>[inputs.Length]; 
		HashSet<char>[] orderedSets = new HashSet<char>[inputs.Length]; 
		
		for (int i = 0; i < inputs.Length; i++) 
		{
			sets[i] = new HashSet<char>(inputs[i]);
		}
		
		Dictionary<char, char> charMap = new Dictionary<char, char>();	
		orderedSets[1] = sets.Where(s => s.Count == 2).First();
		orderedSets[4] = sets.Where(s => s.Count == 4).First();
		orderedSets[7] = sets.Where(s => s.Count == 3).First();
		orderedSets[8] = sets.Where(s => s.Count == 7).First();		
		orderedSets[3] = sets.Where(s => s.Count == 5 && s.IsSupersetOf(orderedSets[7])).FirstOrDefault();
		orderedSets[9] = sets.Where(s => s.Count == 6 && s.SetEquals(new HashSet<char>(orderedSets[3].Union(orderedSets[4])))).FirstOrDefault();
		orderedSets[0] = sets.Where(s => s.Count == 6 && !s.SetEquals(orderedSets[9]) && s.IsSupersetOf(orderedSets[1])).FirstOrDefault();
		orderedSets[6] = sets.Where(s => s.Count == 6 && !s.SetEquals(orderedSets[9]) && !s.SetEquals(orderedSets[0])).FirstOrDefault();
		orderedSets[5] = sets.Where(s => s.Count == 5 && orderedSets[6].IsSupersetOf(s)).FirstOrDefault();
		orderedSets[2] = sets.Where(s => s.Count == 5 && !s.SetEquals(orderedSets[3]) && !s.SetEquals(orderedSets[5])).FirstOrDefault();
		
		return orderedSets;
	}
 
